	assert_eq!(iter.size_hint(), (IcedConstants::MNEMONIC_ENUM_COUNT, Some(IcedConstants::MNEMONIC_ENUM_COUNT)));
	assert_eq!(iter.len(), IcedConstants::MNEMONIC_ENUM_COUNT);
